package com.matao.bean;import java.io.Serializable;/** * @author: ZhouYang * @E-mail: ZhouYangGaoGao@163.com * @time:2015-5-5 下午5:01:39 * @Description:TODO */public class BabyInfo implements Serializable {	private String BabyNickName;	private String BabyInfo;	private String Birthday;	private int Gender;	private int BabyAgeScope;	public String getBirthday() {		return Birthday;	}	public void setBirthday(String birthday) {		Birthday = birthday;	}	@Override	public String toString() {		return "BabyInfo [BabyNickName=" + BabyNickName + ", BabyInfo="				+ BabyInfo + ", Birthday=" + Birthday + ", Gender=" + Gender				+ ", BabyAgeScope=" + BabyAgeScope + "]";	}	public String getBabyNickName() {		return BabyNickName;	}	public void setBabyNickName(String babyNickName) {		BabyNickName = babyNickName;	}	public String getBabyInfo() {		return BabyInfo;	}	public void setBabyInfo(String babyInfo) {		BabyInfo = babyInfo;	}	public int getGender() {		return Gender;	}	public void setGender(int gender) {		Gender = gender;	}	public int getBabyAgeScope() {		return BabyAgeScope;	}	public void setBabyAgeScope(int babyAgeScope) {		BabyAgeScope = babyAgeScope;	}}